(7631, 576, '_form', '<h4>Data Diri</h4>\n<div class=\"row\">\n                            <div class=\"col-md-12\">\n                                <label>Nama Lengkap</label>\n                                [text* Your-name id:name placeholder \"Nama Lengkap\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Email</label>\n                                [email* Your-email id:email placeholder \"Email\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Telepon</label>\n                                [text* Your-telepon id:telepon placeholder \"Telepon\"]\n                            </div>\n\n                            <div class=\"col-md-12\">\n                                <label>Alamat Lengkap</label>\n                                [textarea* alamat id:alamat placeholder \"Alamat Lengkap\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>ID Instagram</label>\n                                [text* instagram id:instagram placeholder \"ID Instagram\"]\n                            </div>\n                           \n                        </div>\n[cf7mls_step cf7mls_step-1 \"Selanjutnya\" \"\"]<h4>Data Proyek</h4>\n<div class=\"row\">\n                            <div class=\"col-md-12\">\n                                <label>Nama Proyek</label>\n                                [text* name-proyek id:name-proyek placeholder \"Nama Proyek\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Alamat Lengkap Proyek</label>\n                                [textarea* alamat-proyek id:alamat placeholder \"Alamat Lengkap Proyek\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Luas ruang/bangunan yang direnovasi/dibangun (m2)</label>\n                                [text* luas-bangunan id:luasbangunan placeholder \"Luas ruang/bangunan yang direnovasi/dibangun (m2)\"]\n                            </div>\n\n                            <div class=\"col-md-12\">\n                              <label>Total biaya Desain Interior</label>  \n                              [text* biaya-Desain-Interior id:biaya-Desain-Interior placeholder \"Total biaya Desain Interior\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Total biaya Desain Arsitektur & Interior</label> \n                                [text* biaya-Desain-Arsitektur-Interior id:biaya-Desain-Arsitektur-Interior placeholder \"Total biaya Desain Arsitektur & Interior\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Jumlah orang yang menggunakan ruangan/bangunan setiap harinya</label>\n                                [text* jumlah-pengguna-bangunan id:jumlah-pengguna-bangunan placeholder \"Jumlah orang yang menggunakan ruangan/bangunan setiap harinya\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Kendala/kekurangan kondisi ruangan/bangunan saat ini</label>\n                                [text* kondisi-ruangan id:kondisi-ruangan placeholder \"Kendala/kekurangan kondisi ruangan/bangunan saat ini\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Aktivitas sehari-hari orang di dalam ruangan/bangunan</label>\n                                [text* aktivitas-ruangan id:aktivitas-ruangan placeholder \"Aktivitas sehari-hari orang di dalam ruangan/bangunan\"]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Kebutuhan/fasilitas ruang yang harus tersedia di dalam ruangan/bangunan</label>\n                                [text* kebutuhan-ruangan id:kebutuhan-ruangan placeholder \"Kebutuhan/fasilitas ruang yang harus tersedia di dalam ruangan/bangunan\"]\n                            </div>\n                        </div>[cf7mls_step cf7mls_step-2 \"Kembali\" \"Selanjutnya\" \"Step 2\"]<h4>Data Lampiran</h4>\n<div class=\"row\">\n                            <div class=\"col-md-12\">\n                                <label>Foto ruangan/bangunan saat ini</label>\n                                [file* foto-bangunan limit:10000000]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Referensi desain yang diinginkan</label>\n                                [file* referensi-bangunan limit:10000000]\n                            </div>\n                            <div class=\"col-md-12\">\n                                <label>Denah rumah</label>\n                                [file* denah-rumah limit:10000000]\n                            </div>\n                        </div>\n[cf7mls_step cf7mls_step-3 \"Kembali\" \"Selanjutnya\" \"Step 3\"]<h4>Lainnya</h4>\n<div class=\"row\">\n                            <div class=\"col-md-12\">\n                                <label>Catatan</label>\n                                [textarea* catatan id:catatan placeholder \"Catatan\"]\n                            </div>\n                          <div class=\"col-md-12\">\n                                [submit class:butn-dark class:order class:mt-15 \"Kirim\"]\n                            </div>  \n                        </div>\n[cf7mls_step cf7mls_step-4 \"Kembali\" \"Step 4\"]'),
